INSERT INTO `modelo` (`id`, `nome`, `detalhe`, `estado`, `criador_id`, `alterador_id`, `criado_em`, `alterado_em`) VALUES
	(1, 'Receita', '<p class="ql-align-right"><img src="data:image/png;base64,"></p><p class="ql-align-right"><span style="color: rgb(136, 136, 136);">----------------------------------------------------------------------------------------------</span></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><h3 class="ql-align-center"><strong>Receita</strong></h3><p class="ql-align-center"><br></p><p><span class="ql-font-monospace">Paciente:</span><span style="background-color: transparent; color: rgb(0, 0, 0);" class="ql-font-monospace">&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);" class="ql-font-monospace">[[Nome do Paciente?paciente:texto]]</strong></p><p class="ql-align-center"><br></p><p class="ql-align-right"><br></p><p class="ql-align-justify"><span class="ql-font-monospace">[[Medicamento?medicamento:lista=receita]]</span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify"><span class="ql-font-monospace"> [[Data de Hoje?hoje:data_extenso]]</span></p><p><br></p>', 1, 1, 1, 0, 1680815300),
	(3, 'Atestado', '<p class="ql-align-right"><img src="data:image/png;base64,"></p><p class="ql-align-right"><span style="color: rgb(136, 136, 136);">----------------------------------------------------------------------------------------------</span></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><h3 class="ql-align-center"><strong><u>Atestado</u></strong></h3><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-justify">	Atestamos para os devidos fins, que o paciente [[Nome do Paciente?paciente:texto]] esteve em consulta no [[O dia de Hoje?dia:dia]] pela [[Período?periodo:escolha=manhã,tarde]].</p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p><br></p><p class="ql-align-justify">&nbsp;[[Data de Hoje?hoje:data_extenso]]</p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p>', 1, 0, 0, 1658863122, 1680815656),
	(6, 'Exames', '<p class="ql-align-right"><img src="data:image/png;base64,"></p><p class="ql-align-right"><span style="color: rgb(136, 136, 136);">----------------------------------------------------------------------------------------------</span></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><h4 class="ql-align-center"><strong><u>Exames Complementares</u></strong></h4><p class="ql-align-center"><br></p><p><br></p><p>Paciente:<span style="background-color: transparent; color: rgb(0, 0, 0);">&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);">[[Nome do Paciente?paciente:texto]]</strong></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><h3 class="ql-align-justify"><strong class="ql-font-monospace">Solicito:</strong><span class="ql-font-monospace">	</span></h3><p class="ql-align-justify"><br></p><p class="ql-align-justify"><span class="ql-font-monospace">[[Exame?exame:lista=exame]]</span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify"><span class="ql-font-monospace"> [[Data de Hoje?hoje:data]]</span></p>', 1, 0, 0, 1660085579, 1680815170),
